import React from "react";
import { Routes, Route, NavLink } from "react-router-dom";
import Home from "./Home";
import "./style.css";

export default function App() {
    return (
        <>
            {/* Navigation Bar */}
            <nav className="navbar">
                <NavLink to="/" className="nav-item">
                    Home
                </NavLink>
            </nav>

            {/* Route Definitions */}
            <Routes>
                <Route path="/" element={<Home />} />
            </Routes>
        </>
    );
}
